import React, { useState, useEffect } from "react"
import '../App.css'
import Table from 'react-bootstrap/Table';


const ShowSelectedRestaurant = () => {

  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  useEffect(() => {
    setLoading(true);
    fetch("http://localhost:8080/restaurant/api/v1/getSelectedRestaurant/1")
      .then((response) => response.json())
      .then((json) => setData(json))
      .finally(() => {
        setLoading(false);
      });
  }, []);

    return (
    <Table striped bordered hover size="sm">
        <thead>
            <tr>
                <th>restaurantName</th>
                 <th>restaurantAddedBy</th>
                 <th>sessionId</th>
            </tr>
        </thead>

        <tbody>
            {data && data.map(restaurant =>
                 <tr key={restaurant.restaurantName}>
                 <td>{restaurant.restaurantName}</td>
                 <td>{restaurant.restaurantAddedBy}</td>
                 <td>{restaurant.sessionId}</td>
               </tr>
            )}
        </tbody>
    </Table>);
}
export default ShowSelectedRestaurant;
